import React from "react";
import styled from "styled-components";

import landingBG from "../../images/landingpagebg.jpg";
const LandingStyled = styled.div`
  height: 100vh;
  width: 100%;
  display: flex;
  align-items: center;
  position: relative;
  background-image: url(${landingBG});
  background-size: cover;
  background-repeat: no-repeat;
  background-position-x: 300px;

  div.landing-text {
    h1 {
      font-size: 3.188rem;
      font-weight: 900;
    }
    p {
      font-size: 1.5rem;
      font-weight: 200;
    }
    padding: 2rem;
    display: flex;
    flex-direction: column;
    justify-content: center;
    gap: 10px;
    height: 60%;
    width: 50vw;
    background: linear-gradient(
      91.1deg,
      rgba(244, 246, 245, 0.9) -7.89%,
      rgba(255, 255, 255, 0.9) 132.55%
    );
  }
  div.landing-bg {
    top: 0;
    position: absolute;
    z-index: -1;
    height: 100%;
    img {
      width: 100%;
      height: auto;
    }
  }
  @media screen and (max-width: 800px) {
    background-position-x: 0px;
    div.landing-text {
      flex-direction: row;
      width: 100% h1 {
        font-size: 2.5rem;
      }
      p {
        font-size: 1.2rem;
      }
    }
  }
`;
const LandingPage = () => {
  return (
    <LandingStyled>
      <div className="landing-text">
        <h1>Fulfilling All Your Coconut Needs</h1>
        <p>
          Lorem ipsum dolor, sit amet consectetur adipisicing elit. Dolores
          reiciendis odit temporibus praesentium inventore ullam unde nostrum,
          in accusamus rem.
        </p>
      </div>
    </LandingStyled>
  );
};

export default LandingPage;
